<h3>Using Affiliate Hoover</h3>

<p>Please read this guide carefully before you use this addon.</p>

<p>Adding feeds to Wordpress Affiliate Hoover involves three stages.</p>

<p>Firstly, give your feed a name. This has to be unique.</p>

<img src="data:image/jpeg;base64," alt="image one" >

<p>Now click on &ldquo;edit feed details&rdquo;.</p>

<img src="data:image/jpeg;base64," alt="image two" >

<p>Here you can upload CSV files.</p>

<img src="data:image/jpeg;base64," alt="image three" >

<p>Once you are done click on the link &ldquo;feed form&rdquo;.</p>

<img src="data:image/jpeg;base64," alt="image four" >

<p>At the top of the form you will see a list of headers which will look something like this:</p>

<?php

$instructions = <<<EOD
    [#0#] = program_id
    [#1#] = program_name
    [#2#] = product_id
    [#3#] = product_name
    [#4#] = description
    [#5#] = deeplink
    [#6#] = price
    [#7#] = image_url
    [#8#] = category_id
    [#9#] = category_name
    [#10#] = category_path
    [#11#] = merchant_category
    [#12#] = last_updated
EOD;

echo '<pre><strong>';
echo htmlspecialchars($instructions);
echo '</pre></strong>';
?>

<p>These are the headers of the columns. You will need to use this code to create your form.</p>

<p>If you see all the headers with one code then this is because the CSV file is not comma-separated.</p>

<p>The most important form fields are the title and the body. All the other fields are optional.</p>

<p>In the title pick a code from the list and use that. Don't add anything else. You can manually change the title of the post after it has been created, if you so do desire.</p>

<p>In the body you can combine the above code and HTML to create an entry. As an example:</p>

Description:

<?php

$instructions = <<<EOD
    [#4#]

    An image:
    
    <img src="[#7#]">

    A link:

    <a href="[#1#]">[#1#] </a>
EOD;

echo '<pre><strong>';
echo htmlspecialchars($instructions);
echo '</pre></strong>';
?>

<p>The form should look like below:</p>

<img src="data:image/jpeg;base64," alt="image five" >

<p>By clicking on the nofollow checkbox under the body it will automatically add nofollow to outbound link.</p>

<p>You can add categories or tags by using the code or by adding your own or a combination of both.</p>

<p>Click the checkboxes to allow comment or trackbacks on the individual posts.</p>

<p>You do not have to process all entries. Pick which entries to process by specifying the beginning and end entry.</p>

<p>Choose whether you would like to publish your items immediately or as drafts.</p>

<p>Finally, in &ldquo;titles contain keywords&rdquo; and &ldquo;body contains keywords&rdquo; you can filter out unwanted content. For instance, by using the keyword &ldquo;babies monitors&rdquo;in the &ldquo;titles contain keywords&rdquo; field you will ONLY create posts with that keyword in the title.</p>

<p>Now you have three choices: Create and update, create only and synchronize.</p>

<p>'Create and Update' will create new posts AND update existing posts.</p>

<p>'Create only' will create new posts BUT NOT update existing posts.</p>

<p>Think carefully before you click. It may be worth creating a database backup first if you are not familiar with this software.</p>

<p>Synchronise will loop through the file and the database and if it finds items that are published but not in the file it will trash published items. This means that your website won't feature old items that the company no longer sells.</p>

<p>Please create a database backup before using the synchronise feature</p>

<p>My advice when creating the form is to pay close attention to the codes you are cutting and pasting. It is easy to be careless and use the wrong codes from the feed column for the titles or categories.</p>

<p>The process time could be quite lengthy depending on the number of items that are being processed and the power of the server the website sits on.</p>

<p>On my server I can create 500 posts in around ten seconds. It is not recommended to use this plugin if you are on a shared server as you will not have access to the necessary hardware power.</p>

<p><a href="http://wordpress.org/tags/affiliate-hoover?forum_id=10">Please report any bugs or feature suggestions to the Wordpress site</a>.</p>

<h4>Reset</h4>

<p>If you run into issues using this plugin please visit the reset section. Here you can delete all posts and associated database entries on a per feed basis.</p>